SRChh_ROOT6_mcgenProjectSource.cxx:922:54: error: use of deleted function 'KKpart& KKpart::operator=(const KKpart&)'
 922 | for (Int_t i=0;i&lt;101;i++) m_Phot[i] = rhs.m_Phot[i];
 | ^
In file included from KKceex.h:21,
